<h1 class="dark-grey-text">LED UV PRINTERS <span class="blue-text">PORTFOLIO</span></h1>
<p><span class="underlined-subtitle dark-grey-text">Choose the one that suits best for your business</span></p>
<br /><br />
<div class="row">
<p>UV curing references the photo polymerization process that uses UV energy to change a liquid to a solid. Upon absorption of the UV energy, the photo initiator (PI) produces free radicals which initiate cross-linking with binders (monomers and oligomers), in a polymerization reaction to cure or solidify the ink. UV-LED printer technologies refer to a non-impact, inkjet printing technique that instantly cures jetted ink droplets directly onto the printable substrate. The UV-LED lamp that houses the LEDs emits energy onto the specially formulated UV-LED ink, which contains photo initiators and are reactive to the energy emitted by the UV-LED lamp. UV-LED printing offers instant curing of a digitally printed image, with the ability to print onto a WIDE variety of printable media, achieving a unique 3D raised printing effect. UV-LED Printing is environmentally friendly, with minimal emissions and low energy consumption.</p>
<br />
